import Login from './Login'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Sheet from './Sheet';
import RegisterProtectedRoutes from './RegisterProtectedRoute';
import SheetProtectedRoutes from './SheetProtectedRoute';
import Signup from './Signup';

function App() {

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login></Login>}></Route>
        <Route element={<SheetProtectedRoutes></SheetProtectedRoutes>}></Route>
          <Route path="/googlesheet" element={<Sheet></Sheet>}></Route>
        <Route element={<RegisterProtectedRoutes></RegisterProtectedRoutes>}></Route>
          <Route path="/signup" element={<Signup></Signup>}></Route>
      </Routes>
    </Router>
  );
}

export default App;
